import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './styles.css';
import magnusImage from './removedmagnus.png';
import logo from './squarechesslogolong.png';
import logoWhite from './squarechesslogolongwhite.png';

const AboutMagnus = () => {
  const [selectedSection, setSelectedSection] = useState(null);
  const [isLogoHovered, setIsLogoHovered] = useState(false);

  const handleSectionClick = (section) => {
    setSelectedSection(selectedSection === section ? null : section);
  };

  const getBlackPiecePath = (piece) => {
    switch (piece) {
      case 'king':
        return 'f/f0/Chess_kdt45.svg';
      case 'queen':
        return '4/47/Chess_qdt45.svg';
      case 'rook':
        return 'f/ff/Chess_rdt45.svg';
      case 'bishop':
        return '9/98/Chess_bdt45.svg';
      case 'knight':
        return 'e/ef/Chess_ndt45.svg';
      case 'pawn':
        return 'c/c7/Chess_pdt45.svg';
      default:
        return '';
    }
  };

  const getWhitePiecePath = (piece) => {
    switch (piece) {
      case 'king':
        return '4/42/Chess_klt45.svg';
      case 'queen':
        return '1/15/Chess_qlt45.svg';
      case 'rook':
        return '7/72/Chess_rlt45.svg';
      case 'bishop':
        return 'b/b1/Chess_blt45.svg';
      case 'knight':
        return '7/70/Chess_nlt45.svg';
      case 'pawn':
        return '4/45/Chess_plt45.svg';
      default:
        return '';
    }
  };

  const sections = {
    bio: "Magnus Carlsen, born November 30, 1990, is a Norwegian chess grandmaster who is the current World Chess Champion. Carlsen was born in Tonsberg, Norway. He showed an aptitude for intellectual challenges at a young age, memorizing all the areas, capitals, flags, and populations of the world by age five. Carlsen's father introduced him to chess when he was five years old. His early progress was rapid; he was an International Master by age 13 and a grandmaster at 13 years and 148 days, making him the third-youngest grandmaster in history at the time. Over the years, Carlsen has demonstrated his extraordinary talent and versatility in the game, holding titles in both classical and rapid formats and being consistently ranked as the world's top player. His playing style is known for its deep strategic understanding, psychological toughness, and unparalleled endgame skills. Outside of chess, Carlsen has modeled for G-Star Raw, launched his own app, Play Magnus, and been involved in various business ventures.",
    accomplishments: "World Chess Champion (2013â€“present), Four-time World Rapid Chess Champion, Five-time World Blitz Chess Champion, Highest peak rating in history (2882), Longest unbeaten streak in classical chess (125 games), Winner of over 30 super tournaments, Winner of the Chess Oscars, Founder of Play Magnus, Featured in Forbes' 30 Under 30, Global Ambassador for Goodwill, Model for G-Star Raw.",
    skills: {
      positionalPlay: "Carlsen's positional play is often compared to that of chess legends like Anatoly Karpov, showing exceptional understanding of piece placement and strategic planning.",
      endgameMastery: "Carlsen's endgame skills are considered some of the best in the history of chess, known for squeezing wins from seemingly drawn positions.",
      versatility: "Magnus is known for his versatility and deep opening preparation, able to play a wide range of positions and styles with ease.",
      psychologicalStrength: "Carlsen is known for his psychological toughness, often outlasting his opponents and making fewer mistakes under pressure.",
      adaptability: "He is highly adaptable, able to change his playing style to exploit his opponent's weaknesses."
    }
  };

  return (
    <div className="about-magnus">
      <div className="background-image">
        <img src={magnusImage} alt="Magnus Carlsen" className="magnus-image" />
      </div>
      <header>
        <nav>
          <ul>
            <li onMouseEnter={() => setIsLogoHovered(true)}
                onMouseLeave={() => setIsLogoHovered(false)}>
              <Link to="/">
                <img src={isLogoHovered ? logoWhite : logo} alt="Home" style={{ height: '40px' }} />
              </Link>
            </li>
            <li><Link to="/blunder-punisher" className="prepare-link">Blunder Punisher</Link></li>
            <li><Link to="/weakness-finder">Weakness Finder</Link></li>
            <li><Link to="/analysis-board">Analysis Board</Link></li>
            <li><Link to="/about-magnus">About Magnus</Link></li>
          </ul>
        </nav>
        <h1 className="artistic-heading">Magnus Carlsen</h1>
        <p className="artistic-subheading">The Chess Maestro</p>
      </header>
      <main>
      <div className="floating-pieces">
        {['king', 'queen', 'rook', 'bishop', 'knight', 'pawn'].flatMap((piece) =>
          ['black', 'white'].flatMap((color) =>
            [...Array(10)].map((_, i) => (
              <img
                key={`${piece}-${color}-${i}`}
                src={`https://upload.wikimedia.org/wikipedia/commons/${color === 'black' ? getBlackPiecePath(piece) : getWhitePiecePath(piece)}`}
                className={`chess-piece ${piece}-${color}-${i}`}
                alt={`${piece}-${color}`}
              />
            ))
          )
        )}
        <div className="hidden-section bio" onClick={() => handleSectionClick('bio')}>
          <span>Biography</span>
        </div>
        <div className="hidden-section accomplishments" onClick={() => handleSectionClick('accomplishments')}>
          <span>Accomplishments</span>
        </div>
        <div className="hidden-section skills" onClick={() => handleSectionClick('skills')}>
          <span>Skills</span>
        </div>
      </div>

      {selectedSection && (
        <div className={`section-content ${selectedSection}`}>
          {selectedSection === 'bio' && <div className="scrollable-content"><p>{sections.bio}</p></div>}
          {selectedSection === 'accomplishments' && (
            <div className="scrollable-content">
              <ul>{sections.accomplishments.split(', ').map(acc => <li key={acc}>{acc}</li>)}</ul>
            </div>
          )}
          {selectedSection === 'skills' && (
            <div className="scrollable-content">
              <h3>Positional Play</h3>
              <p>{sections.skills.positionalPlay}</p>
              <h3>Endgame Mastery</h3>
              <p>{sections.skills.endgameMastery}</p>
              <h3>Versatility</h3>
              <p>{sections.skills.versatility}</p>
              <h3>Psychological Strength</h3>
              <p>{sections.skills.psychologicalStrength}</p>
              <h3>Adaptability</h3>
              <p>{sections.skills.adaptability}</p>
            </div>
          )}
        </div>
      )}
      </main>
      <footer>
        <p>&copy; 2024 SquareChess.org All rights reserved.</p>
      </footer>
    </div>
  );
};

export default AboutMagnus;
